def SpragueGrundy(bound):
  gnumbers = [0 for i in range(bound+2)]
  for i in range(bound+1):
    excluded = [0 for z in range(i/2+1)]
    for j in range(1, (i+1)/2):
      k = i - j
      excluded[gnumbers[j] ^ gnumbers[k]] = 1
    gnumbers[i] = excluded.index(0)
  return gnumbers[:-1]
